import React from 'react';
import './index.css'
import Header from "./components/Header/header";
import Nav from "./components/Header/nav";

import 'antd/dist/antd.css'
import Banner from "./components/banner/banner";


function App() {
  return (
    <div className="App">
       <Header/>
       <Nav/>
       <div className={'body'}>
           <Banner/>
       </div>

    </div>
  );
}

export default App;
